import './jogos.css'
import { Celula } from '../../models/bingo/celula';

function Jogos() {
  return (
    <div className="jogos">
      <div id='bingo'>
        <Celula texto="ajuda"/>
        <Celula />
        <Celula />
        <Celula />
        <Celula />
      </div>
    </div>
  );
}

export default Jogos;
